import React from "react";
import './App.css';
import { Route, Routes } from 'react-router-dom'
import {Inicio,Catalogo,IniciarSesion,Perfil,AdministrarPropiedades,BannerPropiedadVenta} from  './Layouts'


function App() {

    return (
      <div>
      <Routes>
        <Route exact path="/" element={<Inicio/>} />
        <Route exact path="/catalogo" element={<Catalogo/>} />
        <Route exact path="/iniciarsesion" element={<IniciarSesion/>} />
        <Route exact path="/perfil" element={<Perfil/>} />
        <Route exact path="/administrarpropiedades" element={<AdministrarPropiedades/>} />
        <Route exact path="/ventapropiedad" element={<BannerPropiedadVenta/>} />
      </Routes>
      </div>
    );
}

export default App;
